import React from "react";

function Footer() {
	return (
		<footer class="fixed-bottom py-1 bg-dark">
			<div class="container">
				<p class="display-3">SCEHacks 2021 | Code for California</p>
			</div>
		</footer>
	);
}

export default Footer;
